  ["fathoming"] = "<html><body><h1>fathoming</h1><p>p. pr. & vb. n. of Fathom</p><p>n. 测量<p></p>v. 理解…的真意( fathom的现在分词 ); 彻底了解; 弄清真相</p></body></html>",
