  ["fellest"] = "<html><body><h1>fellest</h1><p>fell<p></p>vi.<p></p>fall的变形<p></p>fell1<p></p>[fel]<p></p>fall的过去式<p></p>fell2<p></p>[fel]<p></p>vt.<p></p>使倒下，击倒，推倒，致…于死地：<p></p>to fell an opponent with a blow<p></p>一拳把对手击倒<p></p>A serious disease felled him.<p></p>一场重病夺去了他的生命。<p></p>砍倒，伐倒(树)，伐(木)；砍伐：<p></p>We will fell these trees.<p></p>我们将砍伐这些树。<p></p>【缝纫】缝平(折缝)<p></p>n.<p></p>(一季所伐的)伐木量<p></p>【缝纫】(衣服等的)折缝<p></p>fell3<p></p>[fel]<p></p>adj.<p></p>凶猛的；残暴的；可怕的；骇人的<p></p>毁灭性的，致命的<p></p>[苏格兰英语]尖锐的，辛辣的<p></p>fell4<p></p>[fel]<p></p>n.<p></p>兽皮；毛皮，生皮<p></p>人的皮肤<p></p>(动物)皮下薄膜<p></p>羊毛，毛丛<p></p>fell5<p></p>[fel]<p></p>n.<p></p>[苏格兰和英格兰英语]<p></p>荒山，岩山<p></p>荒野，沼泽地；高原地带；丘陵<p></p>fall<p></p>[fɔ:l]<p></p>vi.<p></p>(因引力从高处)掉下，落下：<p></p>Apples fell from the tree.<p></p>苹果从树上落下。<p></p>Snow is falling fast.<p></p>雪下得正猛。<p></p>摔倒，跌倒，跪倒：<p></p>He fell into the water.<p></p>他跌入水中。<p></p>The clock fell off the shelf.<p></p>钟从架子上摔了下来。<p></p>(在战争中)伤亡，阵亡，战死；被杀死：<p></p>Many men fell in battle.<p></p>许多人在战斗中战死。<p></p>Two rabbits fell to the hunter's gun.<p></p>两只野兔死在猎手的枪口之下。<p></p>坍倒，倒塌，崩溃，毁坏：<p></p>The building fell.<p></p>那座楼坍塌了。<p></p>下垂，垂下：<p></p>Her golden hair fell in masses over her shoulders.<p></p>她满头金发披垂在她双肩。<p></p>(地面等向下)倾斜：<p></p>land falling away to the sea<p></p>向海洋倾斜的陆地<p></p>(数量、质量、价格、程度、水平等)减少，减低，下降，跌落，降低：<p></p>Prices fell.<p></p>价格下跌了。<p></p>Production fell sharply.<p></p>产量锐减。<p></p>The temperature fell 4℃.<p></p>温度下降了4摄氏度。<p></p>(如政府)垮台，被推翻：<p></p>The govenment has fallen.<p></p>政府已被推翻。<p></p>(地位、声誉、威信等)降低(或丧失)：<p></p>The chairman fell in my opinion after he refused to take a vote.<p></p>主席拒绝进行投票表决后，他的地位在我心目中降低了。<p></p>变坏，堕落；走入歧途；旧时尤指(妇女)失贞，怀孕：<p></p>She tempted him and he fell.<p></p>她引诱了他，他堕落了。<p></p>被征服，被攻克，陷落：<p></p>The city fell to the enemy.<p></p>城市陷落到敌人手中。<p></p>(情绪等)低落，失望，(脸色)变阴沉，沮丧：<p></p>His face fell.<p></p>他脸色变得阴沉。<p></p>(音调)降低，(声音)减弱，减退：<p></p>The voice often falls at the end of a statement.<p></p>在陈述句的句尾，发音通常降低。<p></p>发生，举行，(日期)适逢，正当(某日)：<p></p>The m