  ["flushes"] = "<html><body><h1>flushes</h1><p>n the period of greatest prosperity or productivity<p></p>n a rosy color (especially in the cheeks) taken as a sign of good health<p></p>n sudden brief sensation of heat (associated with menopause and some mental disorders)<p></p>n a poker hand with all 5 cards in the same suit<p></p>n the swift release of a store of affective force<p></p>n a sudden rapid flow (as of water)<p></p>n sudden reddening of the face (as from embarrassment or guilt or shame or modesty)<p></p>v turn red, as if in embarrassment or shame<p></p>v flow freely<p></p>v glow or cause to glow with warm color or light<p></p>v make level or straight<p></p>v rinse, clean, or empty with a liquid<p></p>v irrigate with water from a sluice<p></p>v cause to flow or flood with or as if with water</p><p>n. 一阵强烈情感( flush的名词复数 ); （纸牌游戏） 同花的一手牌<p></p>v. 冲刷( flush的第三人称单数 ); 面红耳赤; （使）脸红; 冲洗（抽水马桶）</p></body></html>",
  ["flushest"] = "<html><body><h1>flushest</h1><p>vi.<p></p>(因窘迫、愤怒、激动等)(脸)发红；(人)脸红：<p></p>She began to flush with excitement.<p></p>她由于激动脸开始发红。<p></p>He flushed when he saw her.<p></p>他一看到她就脸发红。<p></p>突然发红，发亮：<p></p>The aurora flushed into the sky.<p></p>曙光映红天空。<p></p>(水等)逆流，奔流；涌；泛滥：<p></p>The blood flushed into his cheeks.<p></p>血液涌向他的面颊。<p></p>Water flushed through the pipes.<p></p>水从管子奔流而过。<p></p>(用水等)冲洗干净；冲走：<p></p>The toilet flushed.<p></p>抽水马桶放水冲洗。<p></p>【植物学】发芽<p></p>vt.<p></p>使(人)脸红，使(脸等)发红；使发光；使发热：<p></p>Anger flushed his cheeks.<p></p>愤怒使他满脸通红。<p></p>Her forehead was flushed with fever.<p></p>她的前额由于发烧而发烫。<p></p>The setting sun flushed the mountain tops.<p></p>夕阳映红山顶。<p></p>使兴奋，使激动；激励；使振奋；使得意[通常用于被动语态]：<p></p>The young parents were flushed with happiness at the birth of their first son.<p></p>第一个孩子出生的喜悦使得年轻夫妇兴奋不已。<p></p>The team was flushed with its first victory.<p></p>这个队因初次胜利而感振奋。<p></p>(用水)冲洗，冲刷(下水道、厕所等)：<p></p>The engineer decided to flush the hold of the ship.<p></p>轮机师决定用水冲洗船舱。<p></p>排水：<p></p>to flush water from flood hand<p></p>将受淹土地的水排除<p></p>使注满；淹没；漫灌(草地)：<p></p>The river flushed the meadow.<p></p>河水淹没了草地。<p></p>对(家畜)进行催情补饲<p></p>结束(一天的工作)<p></p>拒绝(某人)；辞退(某人)<p></p>【计算机】(表面)划掉<p></p>n.<p></p>脸红，泛红，红光，红晕<p></p>潮红；发烧，发热<p></p>(水)急流，奔流；涌；泛滥；冲洗，冲刷<p></p>萌发，旺盛，活力，精力充沛<p></p>兴奋，激动，振奋，情绪突然高涨<p></p>茁壮成长；嫩芽；嫩草<p></p>(绝经或发热时的)灼热感<p></p>短语:<p></p>flush it<p></p>[美国俚语]<p></p>失败；不及格<p></p>[表示不信、轻蔑语]见鬼去吧<p></p>flush of dawn<p></p>[诗歌用语]晨曦，曙光<p></p>flush of hope<p></p>希望的曙光；希望的实现<p></p>in the first flush<p></p>一时兴起<p></p>处于盛年，青春焕发的时期<p></p>flush2<p></p>[flʌʃ]<p></p>adj.<p></p>(尤指金钱)充足的，充裕的；富裕的，繁荣的<p></p>大量的，丰富的<p></p>面色红润的，血色好的；发红的<p></p>齐平的，同高的，同一平面的<p></p>直接的，正面的；正打中的<p></p>充满活力的，精力充沛的<p></p>注满的，泛滥的<p></p>【印刷】顶格，不缩排的<p></p>【船舶学】平甲板的<p></p>adv.<p></p>齐平地；同高地；对齐地；成一直线地<p></p>直接地；面对面地；恰好地<p></p>vt.<p></p>使成水平，使齐平，把…弄平；嵌平(接合处)：<p></p>使成水平，使齐平，把…弄平；嵌平(接合处)：<p></p>The mason flushed the joint with mortar.<p></p>泥工用灰浆把接缝处抹平。<p></p>flush3<p></p>[flʌʃ]<p></p>【狩猎】<p></p>vi.<p></p>鸟(突然)惊起，惊飞：<p></p>A woodcock flushed from its cover.<p></p>一只兰鹬从藏身处惊飞而起。<p></p>使(鸟等)惊飞<p></p>vt.<p></p>使鸟(突然)惊起，惊飞<p></p>使(从隐蔽处)暴露；把(某人或某动物)(从隐藏处)驱逐出来：<p></p>The police are hoping to flush out the criminals without any shooting.<p></p>警察希望不用放一枪就把罪犯驱赶出来。<p></p>n.<p></p>惊飞的鸟或鸟群<p></p>flush4<p></p>[flʌʃ]<p></p>n.<p></p>【牌戏】(一手)同花牌[参较 royal flush, straight flush]<p></p>【体育】(高山滑雪中用张旗旗杆在山坡规定线路插成的)蛇形门<p></p>adj.<p></p>同花的</p></body></html>",
