  ["flutterer"] = "<html><body><h1>flutterer</h1><p>vi.<p></p>(鸟)鼓翼，振翅，拍翅而飞，盘旋：<p></p>The birds fluttered excitedly in the trees.<p></p>鸟儿在树林中兴奋地飞来飞去。<p></p>Two green-and-white butterflies fluttered past them.<p></p>两只蓝白色的蝴蝶从他们身边飞过。<p></p>(旗帜等)飘动，飘扬；飘落；摆动，拍打：<p></p>The flag fluttered in the breeze.<p></p>旗帜在微风中飘扬。<p></p>Some leaves fluttered to the ground.<p></p>一些树叶飘落到地面。<p></p>奔忙；忙乱；坐立不安，烦躁不安地动：<p></p>She fluttered about the room anxiously.<p></p>她坐立不安地在房间里走来走去。<p></p>(轻微地)颤动，迅速而不规则地运动<p></p>(激动得)抖动，震颤；心绪不宁；(如心脏)不规则跳动：<p></p>Her heart fluttered for a moment.<p></p>她的心脏跳得不规则。<p></p>抖动，发抖，激动：<p></p>Her fingers fluttered.<p></p>她的手指在抖动。<p></p>(用测谎器或多波描记器)对…进行测谎<p></p>vt.<p></p>振(翼)，振(翅)，拍(翅)：<p></p>The bird fluttered its wings in the cage.<p></p>鸟在笼中拍动着翅膀。<p></p>使摆动，使飘动；挥动；使颤动：<p></p>She fluttered her handkerchief from the train window as a goodbye.<p></p>她在火车的窗口挥动着手绢道别。<p></p>使心烦意乱；使焦急，使激动，使恐慌：<p></p>Mary was fluttered by the sudden news.<p></p>玛丽被这个突然的消息弄得心烦意乱。<p></p>进行测谎<p></p>n.<p></p>振翼，拍翅，鼓翼；飘动；飘扬；摆动，颤动<p></p>激动，不安，心烦意乱，焦急<p></p>骚动，轰动<p></p>【病理学】(心脏等的)扑动，振颤<p></p>【航空学】颤振，颤动<p></p>[英国俚语]小赌，投机<p></p>【无线电】(频率)颤动，抖动<p></p>【电视】电视图像颤动<p></p>【音乐】(吹奏管乐器时)舌的振动<p></p>【游泳】= flutter kick<p></p>(每秒变化15次以上的录音速度的)改变，失真<p></p>近义词:<p></p>fly<p></p>短语:<p></p>(all) in a flutter<p></p>惊慌失措，心烦意乱<p></p>fall into a flutter<p></p>陷于极度紧张(或心烦意乱)<p></p>have a flutter<p></p>[口语](在证券交易市场或赛马场)参加小赌<p></p>put (或 throw) someone in (或 into) a flutter<p></p>使某人极度紧张(或心烦意乱)</p></body></html>",
