  ["for"] = "<html><body><h1>for</h1><p>prep. In the most general sense, indicating that in consideration<p></p>   of, in view of, or with reference to, which anything is done or takes<p></p>   place.<p></p>prep. Indicating the antecedent cause or occasion of an action;<p></p>   the motive or inducement accompanying and prompting to an act or state;<p></p>   the reason of anything; that on account of which a thing is or is done.<p></p>prep. Indicating the remoter and indirect object of an act; the<p></p>   end or final cause with reference to which anything is, acts, serves,<p></p>   or is done.<p></p>prep. Indicating that in favor of which, or in promoting which,<p></p>   anything is, or is done; hence, in behalf of; in favor of; on the side<p></p>   of; -- opposed to against.<p></p>prep. Indicating that toward which the action of anything is<p></p>   directed, or the point toward which motion is made; /ntending to go to.<p></p>prep. Indicating that on place of or instead of which anything<p></p>   acts or serves, or that to which a substitute, an equivalent, a<p></p>   compensation, or the like, is offered or made; instead of, or place of.<p></p>prep. Indicating that in the character of or as being which<p></p>   anything is regarded or treated; to be, or as being.<p></p>prep. Indicating that instead of which something else controls in<p></p>   the performing of an action, or that in spite of which anything is<p></p>   done, occurs, or is; hence, equivalent to notwithstanding, in spite of;<p></p>   -- generally followed by all, aught, anything, etc.<p></p>prep. Indicating the space or time through which an action or<p></p>   state extends; hence, during; in or through the space or time of.<p></p>prep. Indicating that in prevention of which, or through fear of<p></p>   which, anything is done.<p></p>conj. Because; by reason that; for that; indicating, in Old<p></p>   English, the reason of anything.<p></p>conj. Since; because; introducing a reason of something befo