  ["fussers"] = "<html><body><h1>fussers</h1><p>fusser<p></p>n.<p></p>fuss的变形<p></p>fuss<p></p>[fʌs]<p></p>n.<p></p>奔忙，瞎忙，不必要的麻烦，无谓纷扰，小题大做<p></p>(神经质的)激动，紧张不安；大惊小怪<p></p>[美国口语](激烈的)争吵；争论，辩论<p></p>(对不重要事情的)抱怨，反对，异议<p></p>vi.<p></p>大惊小怪，小题大做：<p></p>Stop fussing and do your work!<p></p>别大惊小怪，干你的工作吧!<p></p>(尤指对琐事)瞎忙，忙乱；无谓纷扰，烦恼，担心，焦急：<p></p>She fussed about,scarcely able to hide her impatience.<p></p>她是在无谓纷扰，几乎不能掩盖其不耐烦。<p></p>过分关心，过于体贴；对…过于费心思：<p></p>Don't waste energy fussing over a minor matter.<p></p>不要在微小的事情浪费精力。<p></p>过分讲究：<p></p>Don't fuss with your clothes.<p></p>不要过分讲究你的衣着。<p></p>(婴儿般)嘀咕，发牢骚，抱怨；争辩：<p></p>a fussing girl<p></p>抱怨的女孩<p></p>[美国俚语]追求女人，讨好女性，与女子约会<p></p>vt.<p></p>[口语]使烦恼，使烦躁，使无谓烦扰，打扰：<p></p>Don't fuss me.<p></p>不要来打扰我。<p></p>He can be fussed by the least little thing.<p></p>最微不足道的事能使他紧张不安。<p></p>[美国俚语]对(女子)献殷勤；追求(女人)，与(女人)约会<p></p>短语:<p></p>fuss and feathers<p></p>[口语]大吹大擂，过分夸耀<p></p>无谓的烦恼和激动，不必要的紧张和忧虑<p></p>fuss up and down<p></p>忙得团团转<p></p>kick up a fuss<p></p>[口语]大吵大闹；引起骚乱；挑起事端<p></p>make a fuss about<p></p>(为…)大吵大闹；(为…)闹事<p></p>make a fuss of (或 over)<p></p>过分关心(或体贴)</p></body></html>",
